\u8DDF`,paraId:305,tocIndex:62},{value:"8.\u5B57\u7B26\u4E32\u8F6C\u6362\u6574\u6570-atoi",paraId:306,tocIndex:62},{value:"\u76F8\u540C",paraId:305,tocIndex:62},{value:`/**
 * @param {string} s
 * @return {number}
 */
var strToInt = function (s) {
  if (s.length === 0) return 0;
  const atoi = new Atoi();
  for (const c of s) {
    atoi.get(c);
  }
  let res = atoi.flag ? Number(atoi.strNum) : -Number(atoi.strNum);
  // \u6EA2\u51FA\u5224\u65AD
  if (res >= Math.pow(2, 31)) return Math.pow(2, 31) - 1;
  if (res < -Math.pow(2, 31)) return -Math.pow(2, 31);
  return res;
};

class Atoi {
  constructor() {
    this.flag = 1; // 1\u8868\u793A\u6B63\u53F7
    this.strNum = '';
    this.state = 'start';
    // " " "+/-" "number" "other"
    this.map = new Map([
      ['start', ['start', 'single', 'is_number', 'end']],
      ['single', ['end', 'end', 'is_number', 'end']],
      ['is_number', ['end', 'end', 'is_number', 'end']],
      ['end', ['end', 'end', 'end', 'end']],
    ]);
  }

  get_state(c) {
    if (c === ' ') return 0;
    if (c === '+' || c === '-') return 1;
    if (0 <= Number(c) || Number(c) <= 9) return 2;
    return 3;
  }

  get(c) {
    this.state = this.map.get(this.state)[this.get_state(c)];
    if (this.state === 'single') {
      this.flag = c === '-' ? 0 : 1;
    }
    if (this.state === 'is_number') {
      this.strNum += c;
    }
  }
}
`,paraId:307,tocIndex:62},{value:"\u5251\u6307 Offer 37. \u5E8F\u5217\u5316\u4E8C\u53C9\u6811",paraId:0},{value:"hard",paraId:308,tocIndex:62},{value:"\u8DDF",paraId:309,tocIndex:63},{value:"297.\u4E8C\u53C9\u6811\u7684\u5E8F\u5217\u5316\u4E0E\u53CD\u5E8F\u5217\u5316",paraId:310,tocIndex:63},{value:"\u76F8\u540C",paraId:309,tocIndex:63},{value:`/**
 * Definition for a binary tree node.
 * function TreeNode(val) {
 *     this.val = val;
 *     this.left = this.right = null;
 * }
 */

/**
 * Encodes a tree to a single string.
 *
 * @param {TreeNode} root
 * @return {string}
 */
var serialize = function (root) {
  const res = [];
  const traverse = (node) => {
    if (node === null) return res.push('Null');
    res.push(node.val);
    traverse(node.left);
    traverse(node.right);
  };
  traverse(root);
  return res.toString();
};

/**
 * Decodes your encoded data to tree.
 *
 * @param {string} data
 * @return {TreeNode}
 */
var deserialize = function (data) {
  const nodes = data.split(',');

  const deTraverse = (nodes) => {
    if (nodes[0] === 'Null') {
      nodes.shift();
      return null;
    }
    const rootVal = nodes.shift();
    const root = new TreeNode(rootVal);

    root.left = deTraverse(nodes);
    root.right = deTraverse(nodes);
    return root;
  };

  return deTraverse(nodes);
};

/**
 * Your functions will be called as such:
 * deserialize(serialize(root));
 */
`,paraId:311,tocIndex:63},{value:"\u5251\u6307 Offer 03. \u6570\u7EC4\u4E2D\u91CD\u590D\u7684\u6570\u5B57",paraId:0},{value:"hard",paraId:312,tocIndex:63},{value:"\u8DDF",paraId:313,tocIndex:64},{value:"10.\u6B63\u5219\u8868\u8FBE\u5F0F\u5339\u914D",paraId:314,tocIndex:64},{value:"\u76F8\u540C",paraId:313,tocIndex:64},{value:`/**
 * @param {string} s
 * @param {string} p
 * @return {boolean}
 */
var isMatch = function (s, p) {
  const m = s.length,
    n = p.length;
  const memo = new Map(); // \u5907\u5FD8\u5F55

  // \u542B\u4E49\uFF1A\u8BA1\u7B97 p[j..] \u662F\u5426\u5339\u914D s[i..]
  const dp = (s, i, p, j) => {
    // base case
    // 1.\u5F53j\u8D70\u5230\u5C3E\u90E8\u7684\u65F6\u5019\uFF0C\u5224\u65ADi\u662F\u5426\u4E5F\u8D70\u5230\u5934
    if (j === n) return i === m;

    // 2.\u5F53i\u8D70\u5230\u5934
    if (i === m) {
      // 2.1 \u5982\u679C\u80FD\u5339\u914D\u4E0A x* \u80AF\u5B9A\u662F\u6210\u5BF9\u51FA\u73B0\u7684\uFF0C\u4E3A\u4E0B\u4E00\u6B65\u8FDB\u884C\u7B5B\u9009
      if ((n - j) % 2 !== 0) return false;
      // 2.2 \u68C0\u67E5\u662F\u5426\u4E3A x*y*z* \u8FD9\u79CD\u5F62\u5F0F
      for (; j + 1 < n; j += 2) {
        if (p[j + 1] !== '*') {
          return false;
        }
      }
      // 2.3 \u4E0A\u9762\u4E24\u79CD\u60C5\u51B5\u90FD\u4E0D\u6EE1\u8DB3\uFF0C\u90A3\u4E48\u8BF4\u660E\u5269\u4E0B\u7684p\u53EF\u4EE5\u88AB\u5339\u914D\u5230
      return true;
    }

    // \u8BBE\u7F6E\u5907\u5FD8\u5F55\uFF0C\u6D88\u9664\u91CD\u53E0\u5B50\u95EE\u9898
    const key = i + ' ' + j;
    if (memo.has(key)) return memo.get(key);

    let res = false;

    // 1.s[i] === p[j]\uFF0C\u5339\u914D\u300C.\u300D\u7684\u65F6\u5019
    if (s[i] === p[j] || p[j] === '.') {
      // 1.1 \u5339\u914D\u4E0A\u300C*\u300D
      if (j + 1 < n && p[j + 1] === '*') {
        // \u300C.*\u300D \u7684\u60C5\u51B5\u4E0B\uFF0C\u300C*\u300D\u53EF\u80FD\u4F1A\u5339\u914D0\u6B21\u5230\u591A\u6B21
        res =
          dp(s, i, p, j + 2) || // 0\u6B21
          dp(s, i + 1, p, j); // \u591A\u6B21
      } else {
        // \u300C.\u300D\u7684\u60C5\u51B5\u4E0B\u5C31 \u5E38\u89C4\u5339\u914D1\u6B21
        res = dp(s, i + 1, p, j + 1);
      }
    } else {
      // 2.s[i] !== p[j],\u4E0D\u5339\u914D\u300C.\u300D\u7684\u65F6\u5019
      if (j + 1 < n && p[j + 1] === '*') {
        // 2.1\u300C*\u300D\u7684\u60C5\u51B5\u4E0B,\u5339\u914D0\u6B21,\u7136\u540E\u770B\u4E0B\u4E00\u4E2A\u5B57\u7B26\u662F\u5426\u5339\u914D
        // eg: s = "aa", p = "b*aa"
        res = dp(s, i, p, j + 2);
      } else {
        // s[i] !== p[j] \u6CA1\u6709\u300C.\u300D \u6CA1\u6709\u300C*\u300D \u5339\u914D\u5C31\u65E0\u6CD5\u8FDB\u884C\u4E0B\u53BB\u4E86
        res = false;
      }
    }

    memo.set(key, res);
    return res;
  };

  return dp(s, 0, p, 0);
};
`,paraId:315,tocIndex:64},{value:"\u5251\u6307 Offer 49. \u4E11\u6570",paraId:0},{value:"medium",paraId:316,tocIndex:64},{value:"\u8DDF",paraId:317,tocIndex:65},{value:"264.\u4E11\u6570-ii",paraId:318,tocIndex:65},{value:"\u76F8\u540C",paraId:317,tocIndex:65},{value:`/**
 * @param {number} n
 * @return {number}
 */
// \u5408\u5E762\uFF0C3\uFF0C5\u500D\u901F\u7684\u94FE\u8868
var nthUglyNumber = function (n) {
  if (n === 1) return 1;
  let p_2 = 1,
    p_3 = 1,
    p_5 = 1; // \u7406\u89E3\u4E3A\u5934\u8282\u70B9\u7684\u503C
  let p2 = 1,
    p3 = 1,
    p5 = 1; // \u7406\u89E3\u4E3A\u94FE\u8868\u5934\u8282\u70B9
  // \u7ED3\u679C\u94FE\u8868
  const ugly = new Array(n + 1).fill(0);
  // \u7ED3\u679C\u94FE\u8868\u4E0A\u7684\u6307\u9488
  let p = 1;

  while (p <= n) {
    let min = Math.min(p_2, p_3, p_5);
    ugly[p] = min;
    p++;
    // \u6307\u9488\u540E\u79FB
    if (min === p_2) {
      p_2 = ugly[p2] * 2;
      p2++;
    }
    if (min === p_3) {
      p_3 = ugly[p3] * 3;
      p3++;
    }
    if (min === p_5) {
      p_5 = ugly[p5] * 5;
      p5++;
    }
  }

  return ugly[n];
};
`,paraId:319,tocIndex:65},{value:"\u5251\u6307 Offer 60. n \u4E2A\u9AB0\u5B50\u7684\u70B9\u6570",paraId:0},{value:"medium",paraId:320,tocIndex:65},{value:"\u9996\u5148\uFF0C\u4E00\u4E2A\u9AB0\u5B50\u80FD\u6254\u51FA\u7684\u70B9\u6570\u662F 1~6\uFF0C",paraId:321,tocIndex:66},{value:"\u90A3\u4E48 n \u4E2A\u9AB0\u5B50\u6254\u51FA\u70B9\u6570 point \u7684\u6982\u7387",paraId:321,tocIndex:66},{value:"\u5C31\u53EF\u4EE5\u901A\u8FC7 n - 1 \u4E2A\u9AB0\u5B50\u6254\u51FA\u70B9\u6570 point-1, point-2,... point-6 \u7684\u6982\u7387\u5206\u522B\u4E58\u4EE5 1/6 \u518D\u76F8\u52A0\u5F97\u5230\u3002",paraId:321,tocIndex:66},{value:`/**
 * @param {number} n
 * @return {number[]}
 */
var dicesProbability = function (n) {
  const min = n,
    max = n * 6;
  const memo = new Array(n + 1).fill().map((_) => new Array(max + 1).fill(0));

  // \u7528n\u4E2A\u9AB0\u5B50\uFF0C\u629B\u51FApoint\u70B9\u6570\u5230\u6982\u7387
  const dp = (n, point) => {
    if (point <= 0) return 0;
    if (n === 1) {
      if (point > 6) return 0;
      return 1 / 6.0;
    }
    if (memo[n][point] !== 0) return memo[n][point];

    let procent = 0;
    for (let i = 1; i <= 6; i++) {
      procent += (dp(n - 1, point - i) * 1) / 6.0;
    }
    memo[n][point] = procent;
    return procent;
  };

  const res = new Array(max - min + 1);
  for (let i = 0; i < res.length; i++) {
    res[i] = dp(n, min + i);
  }
  return res;
};
`,paraId:322,tocIndex:66},{value:"\u5251\u6307 Offer 17. \u6253\u5370\u4ECE1\u5230\u6700\u5927\u7684n\u4F4D\u6570",paraId:0},{value:"easy",paraId:323,tocIndex:66},{value:`/**
 * @param {number} n
 * @return {number[]}
 */
var printNumbers = function (n) {
  const res = [];
  // \u751F\u6210 n\u4F4D9 \u5982\uFF1An=3 ==> 999
  let end = new Array(n).fill("9").join("");
  for (let i = 1; i <= Number(end); i++) {
    res.push(i);
  }
  return res;
};
`,paraId:324,tocIndex:67},{value:"\u5251\u6307 Offer 51. \u6570\u7EC4\u4E2D\u7684\u9006\u5E8F\u5BF9",paraId:0},{value:"hard",paraId:325,tocIndex:67},{value:"\u8DDF",paraId:326,tocIndex:68},{value:"493.\u7FFB\u8F6C\u5BF9",paraId:327,tocIndex:68},{value:"\u76F8\u4F3C",paraId:326,tocIndex:68},{value:`/**
 * @param {number[]} nums
 * @return {number}
 */
// \u5728\u5F52\u5E76\u6392\u5E8F\u4E2D\u5904\u7406
var reversePairs = function (nums) {
  const n = nums.length;
  if (n === 0) return 0;
  const temp = new Array(n);
  let count = 0;

  const merge = (lo, mid, hi) => {
    for (let i = lo; i <= hi; i++) {
      temp[i] = nums[i];
    }

    // ---\u5DE6\u53F3\u6570\u7EC4\u6709\u5E8F\u4E4B\u524D---
    // let start = lo, end = mid + 1;
    // while (start <= mid && end <= hi) {
    //     if (nums[start] > nums[end]) {
    //         count += mid + 1 - start;
    //         end++;
    //     } else {
    //         start++;
    //     }
    // }

    // \u7EF4\u62A4\u4E00\u4E2A[mid+1,end)\u7684\u533A\u95F4\uFF0C\u662Fnums[i] > num[j]\u9006\u5E8F\u5BF9
    let end = mid + 1;
    for (let start = lo; start <= mid; start++) {
      while (end <= hi && nums[start] > nums[end]) {
        end++;
      }
      count += end - (mid + 1);
    }

    // ---\u5DE6\u53F3\u6570\u7EC4\u6709\u5E8F---
    let i = lo,
      j = mid + 1;
    for (let p = lo; p <= hi; p++) {
      if (i === mid + 1) {
        nums[p] = temp[j++];
      } else if (j === hi + 1) {
        nums[p] = temp[i++];
      } else if (temp[i] > temp[j]) {
        nums[p] = temp[j++];
      } else if (temp[i] <= temp[j]) {
        nums[p] = temp[i++];
      }
    }
  };

  const sort = (lo, hi) => {
    // \u5355\u4E2A\u5143\u7D20\u4E0D\u7528\u6392\u5E8F
    if (lo === hi) return;
    // const mid = Math.floor(lo + (hi - lo) / 2);
    const mid = lo + ((hi - lo) >> 1);
    sort(lo, mid);
    sort(mid + 1, hi);
    // \u5408\u5E76[lo,mid][mid,hi]
    merge(lo, mid, hi);
  };

  // \u5F52\u5E76
  sort(0, n - 1);
  return count;
};
`,paraId:328,tocIndex:68},{value:"\u5251\u6307 Offer 14- II. \u526A\u7EF3\u5B50 II",paraId:0},{value:"medium",paraId:329,tocIndex:68},{value:"\u8DDF",paraId:330,tocIndex:69},{value:"343.\u6574\u6570\u62C6\u5206",paraId:331,tocIndex:69},{value:"\u76F8\u540C",paraId:330,tocIndex:69},{value:`/**
 * @param {number} n
 * @return {number}
 */
var cuttingRope = function (n) {
  // \u5B9A\u4E49dp[i]\u8868\u793A i\u5206\u89E3\u540E \u7684\u6700\u5927\u4E58\u79EF
  let dp = new Array(n + 1).fill(0n);
  dp[0] = dp[1] = 0n; // 0\u548C1\u4E0D\u80FD\u88AB\u62C6\u5206
  const MOD = 1000000007n;
  for (let i = 2; i <= n; i++) {
    let curMax = 0n;
    for (let j = 0; j < i; j++) {
      const subProblem1 = BigInt(j * (i - j));
      const subProblem2 = BigInt(j) * dp[i - j];
      const res = subProblem1 > subProblem2 ? subProblem1 : subProblem2;
      curMax = curMax > res ? curMax : res;
    }

    dp[i] = curMax;
  }

  return dp[n] % MOD;
};
