\u53CD\u4E4B\u4E0D\u80FD\u5230\u8FBE`,paraId:2,tocIndex:1},{value:"\u8FD9\u9053\u9898\u8868\u9762\u4E0A\u4E0D\u662F\u6C42\u6700\u503C\uFF0C\u4F46\u662F\u53EF\u4EE5\u6539\u4E00\u6539\uFF1A",paraId:3,tocIndex:1},{value:"\u8BF7\u95EE\u901A\u8FC7\u9898\u76EE\u4E2D\u7684\u8DF3\u8DC3\u89C4\u5219\uFF0C\u6700\u591A\u80FD\u8DF3\u591A\u8FDC\uFF1F\u5982\u679C\u80FD\u591F\u8D8A\u8FC7\u6700\u540E\u4E00\u683C\uFF0C\u8FD4\u56DE true\uFF0C\u5426\u5219\u8FD4\u56DE false\u3002",paraId:3,tocIndex:1},{value:`/**
 * @param {number[]} nums
 * @return {boolean}
 */
var canJump = function (nums) {
  let len = nums.length;
  let farthest = 0; // \u6700\u8FDC\u8DDD\u79BB
  for (let i = 0; i < len - 1; i++) {
    farthest = Math.max(farthest, i + nums[i]);
    if (farthest - i <= 0) {
      return false;
    }
  }
  return farthest >= len - 1;
};
