`,paraId:18,tocIndex:4},{value:"\u8DDF\u636E end \u8FDB\u884C\u5347\u5E8F\u6392\u5217",paraId:19,tocIndex:4},{value:"\u627E\u51FA\u8DDF end \u4E0D\u91CD\u53E0\u7684\u533A\u95F4\uFF0C\u8BA1\u6570\u5668++\uFF0C\u6539\u53D8 end \u7684\u503C\uFF0C\u7EE7\u7EED\u904D\u5386",paraId:19,tocIndex:4},{value:`/**
 * @param {number[][]} intervals
 * @return {number}
 */
var eraseOverlapIntervals = function (intervals) {
  // \u5982\u679C\u4E3A\u7A7A\uFF0C\u4E0D\u9700\u8981\u6539\u53D8
  if (!intervals.length) return 0;
  let endSortArr = intervals.sort((a, b) => a[1] - b[1]);

  // \u8BA1\u7B97\u6709\u591A\u5C11\u4E0D\u91CD\u590D\u7684\u533A\u95F4\uFF0C\u81F3\u5C11\u4E3A \u5F00\u5934\u7684\u6570\u91CF1
  let count = 1;
  let end_start = endSortArr[0][1];

  for (let item of endSortArr) {
    if (item[0] >= end_start) {
      count++;
      end_start = item[1];
    }
  }

  return endSortArr.length - count;
};
